    var getHeatOption = function(data){
        var option = jQuery.extend(true, {}, option_heat);
        option['series'][0]['data'] = data['data']['heatmap'];
        option['yAxis']['data'] = data['data']['columes'].reverse();
        var max = 0;
        var min = 0;
        for (var i in data['data']['heatmap']) {
          if (data['data']['heatmap'][i][2] > max)
              max = data['data']['heatmap'][i][2];
          if (data['data']['heatmap'][i][2] < min)
              min = data['data']['heatmap'][i][2];
        }
        option.visualMap.max = max;
        option.visualMap.min = min;

        var maxAge = data['data']['values'][0]['data'].length - 1;
        var xAxisArray = [];
        for(var k = 0; k < maxAge + 1; k++){
          xAxisArray.push(k);
        }
        option['xAxis']['data'] = xAxisArray;
        return option;
    };

